def findEndRowValue(arr):
    size = len(arr)
    diff = arr[size - 1] - arr[0]
    end_val = arr[size - 2] + diff
    print(end_val)
    results = reduceArr(end_val, arr)
    return max(results)

def reduceArr(endVal, arr):
    results = [0] * len(arr)
    for i in range(len(arr)):
        diff = endVal - arr[i]
        result = count(diff)
        results[i] = result
    return results

def count(diff):
    arr = [1, 2, 5]
    count = 0
    while diff > 0:
        diff -= arr[diff % 3]
        count += 1
    return count


